import {React,useState} from "react"

function Time(){
    const[Seconds, setSeconds]= useState(0)
    const test = () =>{
        setSeconds(Seconds+1)
    } 
    setInterval(test,1000)
    return(
        <div>
            <h2>timer: {Seconds}</h2>
        </div>
    )
}

export default Time
